import React from 'react';
import styled from 'styled-components';
import '../../App.css';
import Drapable from '../Drapable';
import Dropable from '../Dropable';
import { Image, Container } from 'react-bootstrap';

const Wrapper = styled.div`


    display:flex;
    justify-content:center;

`;
const Item = styled.div`
    padding:8px;
    color:#555;
    background-color:white;
    border-radius:3px;
`;
const dropableStyle = {
    backgroundColor: '#555',
    width: '100%',
    height: '1000px',

};
const dropableStyle1 = {
    height: '100%',
    position: 'absolute',
    bottom: '0',
    right: '0',
    zindex: '990',
    background: '#380028',
    width: '280px',


};
export default class DndTest extends React.Component {
    render() {
        return (
            <Container>
                <Wrapper className='col-12'>
                    <Dropable id='dr1' style={dropableStyle}>
                        <Drapable id='item1' >
                            <Item style={{ margin: '8px', display: "flex" }}>

                                <Image id='item1' src={'/img/3.svg'} className='img' />
                                <p>air</p>
                            </Item>
                        </Drapable>

                        <Drapable id='item2'>
                            <Item style={{ margin: '8px' }}>Some other text</Item>
                        </Drapable>
                    </Dropable>
                    <Dropable id='dr2' style={dropableStyle1}></Dropable>
                </Wrapper >
            </Container>
        );
    }
}
